import React from 'react';
import { Link } from 'react-router-dom';

function HomePage({ setUser }) {
  return (
    <div className="home">
      <h1>Welcome to the Moringa Pairing App</h1>
      <p>Login to continue</p>
      <Link to="/login">Login</Link>
    </div>
  );
}

export default HomePage;
